export default class HeroImg {
    constructor() {
        this.heroImg = document.querySelector('.hero-img');

        this.render();
    }

    render() {
        if (window.innerWidth > 270 && window.innerWidth < 1024) {
            this.heroImg.innerHTML = `
                <img src="./public/hero.png" alt="">
                <svg  viewBox="0 0 400 890" fill="none" xmlns="http://www.w3.org/2000/svg"
                    xmlns:xlink="http://www.w3.org/1999/xlink">
                    <rect width="100%" height="100%" fill="url(#pattern0)" />
                    <defs>
                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">                                <use xlink:href="#image0_103_181"
                           transform="matrix(0.00370833 0 0 0.00166667 -1.44688 0)" />
                        </pattern>
                        <image id="image0_103_181" width="1050" height="600"                                    xlink:href="data:image/png;base64," />
                    </defs>
                </svg>`;
        }
    }
}
